import React from "react";
import styles from "../assets/css/branding.module.css";

const Branding = () => {
  const { Branding } = styles;
  return (
    <section className={Branding}>
      <div className="container">
        <div className="row">
          <div className="col-md-2"></div>
        </div>
      </div>
    </section>
  );
};

export default Branding;
